import Header from "./components/Header";

function App() {
  return (
    <div
      style={{
        backgroundColor: "black",
      }}
    >
      <Header />
      <div
        style={{
          height: "10%",
          marginTop: "5%",
        }}
      ></div>
    </div>
  );
}

export default App;
